import postPublications from "../../api/publications";

export const postBike =
  (body: Object, callback: (response: Object, error: Object) => void): Object =>
  async (dispatch) => {
    try {
      const { data } = await postPublications(body);
      const { user, adress, price, available, description, title } = data;
      dispatch({
        businessUser: { ob_status, tenpo_user_id, business_sii, type },
      });
      callback(data, null);
    } catch (error) {
      callback(null, error);
    }
  };
